CREATE TABLE `t_wms_menu` (
  `id` varchar(40) NOT NULL COMMENT '主键ID',
  `menu_name` varchar(200) NOT NULL COMMENT '菜单名称',
  `menu_code` varchar(200) NOT NULL COMMENT '菜单代码',
