  `status` varchar(1) DEFAULT NULL COMMENT '状态  1 启用 0 停用',
  `hidden` varchar(1) DEFAULT NULL COMMENT '是否隐藏 0 否 1 是',
  `icon` varchar(500) DEFAULT NULL COMMENT '图标',
  `component` varchar(1000) DEFAULT NULL COMMENT '页面地址',
  `redirect` varchar(1000) DEFAULT NULL COMMENT '重定向',
  `path` varchar(1000) DEFAULT NULL COMMENT '路径',
